CREATE TABLE IF NOT EXISTS "flights" (
    "row_id" TEXT,
    "id" TEXT,
    "valid_until" TEXT,
    "legs_id" TEXT,
    "legs_route_info_id" TEXT,
    "legs_route_info_from_id" TEXT,
    "legs_route_info_from_name" TEXT,
    "legs_route_info_to_id" TEXT,
    "legs_route_info_to_name" TEXT,
    "legs_route_info_distance" BIGINT,
    "legs_providers_id" TEXT,
    "legs_providers_company_id" TEXT,
    "legs_providers_company_name" TEXT,
    "legs_providers_price" NUMERIC(9, 2),
    "legs_providers_flight_start" TEXT,
    "legs_providers_flight_end" TEXT
);
ON CONFLICT (row_id)
DO UPDATE SET id = excluded.id,
              "valid_until" = excluded."valid_until",
              legs_id= excluded.legs_id,
              "legs_route_info_id"=excluded."legs_route_info_id",
              "legs_route_info_from_name"=excluded."legs_route_info_from_name",
              "legs_route_info_to_id" = excluded."legs_route_info_to_id",
              "legs_route_info_to_name"=excluded."legs_route_info_to_name",
              "legs_route_info_distance"=excluded."legs_route_info_distance",
              "legs_providers_id"=excluded."legs_providers_id",
              "legs_providers_company_id"=excluded."legs_providers_company_id",
              "legs_providers_company_name"=excluded."legs_providers_company_name",
              "legs_providers_price"=excluded."legs_providers_price",
              "legs_providers_flight_start"=excluded."legs_providers_flight_start",
              "legs_providers_flight_end"=excluded."legs_providers_flight_end";